import React from 'react'
import { AppBar, Toolbar } from "@material-ui/core";

export default function Header() {
    const Header = () => {
        return <Toolbar>Navigator</Toolbar>
    };

    return (
        <header>
          <AppBar>{Header()}</AppBar>
        </header>
      );
}
